import { Link } from "react-router-dom";
import styles from "./Nav.module.css"
import { useContext } from "react";
import { PrContent } from "../contexts/prContent";
function Nav({nav}){
    const temp = useContext(PrContent)
    const {content2, setContent2} = temp;
    const handleClick = () =>{
        setTimeout(() => {
            setContent2(true)
        }, 10000);
    }
    return(
        <>
            <div className={`${nav ? `${styles.header_container} ${styles.transition}` : `${styles.header_container} ${styles.transition}`}`}>
            <div className={nav? styles.won : styles.won1} >
                <h1>
                    <Link to={"/"}>
                        <button onClick={handleClick} className={nav ? styles.navbtn1 : styles.navbtn1}>JN</button>
                    </Link>
                </h1>
                <nav>
                    <ul className={styles.nav_container}>
                        <li >
                            {nav ? (<Link to={"about"}>
                                <button  className={ nav ? styles.navbtn :styles.navbtn}>About Me</button>
                            </Link>):( <button className={ nav ? styles.navbtn :styles.navbtn}>About Me</button>)}
                            
                        </li>
                        <li>
                            <button className={nav ? styles.navbtn :styles.navbtn}>Features</button>
                        </li>
                        <li>
                            <button className={nav ? styles.navbtn :styles.navbtn}>Portfolio</button>
                        </li>
                        <li>
                            <button className={nav ? styles.navbtn :styles.navbtn}>Contact</button>
                        </li>
                    </ul>
                </nav>
            </div>
            </div>
        </>
    )
}

export default Nav;
